import * as React from 'react';
import { useContext } from 'react'
import { styled, alpha } from '@mui/material/styles';

import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import InputBase from '@mui/material/InputBase';
import Badge from '@mui/material/Badge';
import MenuItem from '@mui/material/MenuItem';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import LoginIcon from '@mui/icons-material/Login';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';


function LandingPage() {
  return (
    <Box sx={{display:"flex", flexDirection:"column"}}>
      <Paper sx={{
        height: "100vh",
        width: "80vw",
        m:'0 auto'
      }}variant="elevation">
        <Box
            component="img"
            sx={{
            height: "100%",
            width: "100%",
            }}
            alt="Hero image"
            src="HeroImage.png"
            />
      </Paper>
      <Box sx={{display: "flex", flexDirection:"row"}}>
            <Box>
              <Paper 
              component="img"
              sx={{
                height: 200,
                width: 200,
                maxHeight: { xs: 100, md: 250, lg: 300 },
                maxWidth: { xs: 100, md: 250, lg: 300 },
              }}
              alt="Hero image"
              src="../../public/WomensClothing.jpeg"></Paper>
              <Typography>Women</Typography>
            </Box>
            <Box>
              <Paper 
              component="img"
              sx={{
                height: 200,
                width: 200,
                maxHeight: { xs: 100, md: 250, lg: 300 },
                maxWidth: { xs: 100, md: 250, lg: 300 },
              }}
              alt="Hero image"
              src="../../public/Jewelry.webp"></Paper>
              <Typography>Jewelry</Typography>
            </Box>
            <Box>
              <Paper 
              component="img"
              sx={{
                height: 200,
                width: 200,
                maxHeight: { xs: 100, md: 250, lg: 300 },
                maxWidth: { xs: 100, md: 250, lg: 300 },
              }}
              alt="Hero image"
              src="../../public/Mensclothing.jpeg"></Paper>
              <Typography>Men</Typography>
            </Box>
            <Box>
              <Paper 
              component="img"
              sx={{
                height: 200,
                width: 200,
                maxHeight: { xs: 100, md: 250, lg: 300 },
                maxWidth: { xs: 100, md: 250, lg: 300 },
              }}
              alt="Hero image"
              src="../../public/Electronics.jpeg"></Paper>
              <Typography>Electronics</Typography>
            </Box>
      </Box>
    </Box>
  )
}

export default LandingPage
